import React from "react";

const Header = () => {
  return (
    <div className='flex bg-red-500'>
      <div className='flex-row p-10 pb-16 '>
        <h1 className=' ml-10 text-7xl font-extrabold opacity-30  '>
          Doploons
        </h1>
        <h1 className='ml-24 text-7xl font-extrabold opacity-30 '>
          Calculator
        </h1>
      </div>
      <div className='items-end'>
        <select>
          <option>PT</option>
          <option>EN</option>
          <option>FR</option>
          <option>ES</option>
        </select>
      </div>
    </div>
  );
};

export default Header;
